INSERT INTO `site_settings` (`id`, `section_name`, `section_text`, `status`) VALUES
(1, 'site_name', 'dex.stakeProtocal', 1),
(2, 'site_logo', 'images/logo.png', 1),
(3, 'site_important_text', '<p>Welcome to dex.stakeProtocal Decentralized ERC20 Trading Platform!We are the first free token exchange platform. You will never pay us any trading fees. Simply pay GAS, which is required via Ethereum.</p>\r\n<p><strong> How to Start Trading </strong></p>\r\n<p>Use the Deposit form (upper left) to deposit your funds (ETH and tokens) on the exchange. Do not send your tokens directly to the smart contract, or they will be lost and unrecoverable. dex.stakeProtocal cannot help you with funds incorrectly deposited to the smart contract.</p>\r\n<p><strong> dex.stakeProtocal Disclaimer </strong></p>\r\n<p>dex.stakeProtocal is a decentralized trading platform that lets you trade Ether and Ethereum-based tokens directly with other users. You are responsible for your own account, funds, and private keys. You are responsible for your own trading decisions, and the details and mechanics of the tokens you trade. dex.stakeProtocal is not responsible for your decisions, actions, or losses that result from using dex.stakeProtocal. dex.stakeProtocal makes no guarantee about the tokens that you trade using dex.stakeProtocal. dex.stakeProtocal does not hold your funds and does not offer refunds. While the information contained on dex.stakeProtocal is periodically updated, no guarantee is given that the information provided on dex.stakeProtocal is correct, complete, or up-to- date. By using dex.stakeProtocal, you acknowledge this and agree to these terms.</p>', 1),
